import React from "react";
//import App from "../app";
//import Navigation from "../app";
import {CardDeck, Footer, Header, HeroHeader, Navigation, Search} from "../components";


const IndexPage = () => {
  return (
    <div className="index container-fluid">
      <header>
        <Header />
      </header>
      <body>
        <div>
          <HeroHeader />
        </div>
        <div>
          <CardDeck />
        </div>
      </body>
      <footer>
        <Footer />
      </footer>
    </div>
  );
};

export default IndexPage;
